    return (
        <div className="channelRow">
            <Avatar 
                src={image}
                alt={channel}
             />
             <div className="channelRow__text">
                <h4>{channel} {verified && <VerifiedIcon />}</h4>
             </div>
        </div>
    )
}

export default ChannelRow
